import React from 'react';
import '../css/VideoPlayer.css';

const VideoPlayer = (props) => {
  //receives "username" from props

  const vidLink = require(`../resources/videos/${props.videoLink}`);

  getNewVideo = (username) => {
    if (username === null || username === '') {
      return;
    }

    const data = {
      username: username
    };

    fetch('https://yousub-api.nassing.tk/', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(data)
    })
      .then(response => {
        if (response.ok) {
          return response.json();
        } else {
          throw new Error('Error getting video');
        }
      })
      .then(data => {
        this.setState({ videoLink: data.link });
        this.setState({ videoSource: data.source });
      })
      .catch(error => console.log(error.message));
  }



  return (
    <div id="video-player-wrapper">
      <div id="video-player">
        <video src={videoLink} controls loop />
      </div>
    </div>
  );
};

export default VideoPlayer;
